Hexo博客发文&#x2F;配置&#x2F;管理常用指令powershellhexo init  //初始化

hexo new/n (title)  //新建文章

hexo generate/g  //生成静态文件

hexo server/s   //启动本地服务器 进行预览

hexo clean      //清理缓存，有时更改了设置需要清除缓存后才可生效

hexo deploy    //将本地生成的静态文件部署到github仓库中上线javascript&#123;
